import './App.css';
import './css/style.css';
import './css/strip.css';
import Logo from './images/logo.png';

function App() {
  return (
    <div className="App">
		<div className="wrapper">
			<nav>
				<img src={Logo} alt="" />
				<ul className="menu">
					<li><a href="index.html">Home</a></li>
					<li><a href="about.html">About Mansard</a></li>
					<li><a href="gallery.html">Gallery </a></li>
					<li><a href="#">Read My Blog</a></li>
					<li><a href="bookASession.html">Book a Session</a></li>
					<li><a href="contact.html">Contact Us</a></li>
				</ul>
				<div className="copyright">
					<p>Â©2021 Mansard Photography. </p>
				</div>
			</nav>
		</div>
    </div>
  );
}

export default App;
